import { Provider } from "react-redux";
import { store } from './redux/helpers';

import './App.css';
import Routes from './Routes';
import { Navbar, Footer } from './components';

function App() {
  return (
    <Provider store={store}>
      <div>
        <Navbar />
        <Routes />
        <Footer />
      </div>
    </Provider>
  );
}

export default App;
